		function CalcularTablaPoliticas(politicacontenida, mostraragrupacionetnicos) {
			var j = 0;
			var k = 0;

			for (var i = 0; i < politicacontenida.length; i++) {

				if (j <= 2) {

					if (i == 0 && mostraragrupacionetnicos == 1) {
						var adicion = {
							id: k,
							td: [{
								PoliticaId: 0,
								NombrePolitica: 'Grupos étnicos'
							}]
						};
						vm.tr.push(adicion)
						j++;
					}


					if (j == 0) {
						var adicion = {
							id: k,
							td: [{
								PoliticaId: politicacontenida[i].PoliticadependienteId,
								NombrePolitica: politicacontenida[i].NombrePoliticaDependiente
							}]
						};
						vm.tr.push(adicion)
						j++;
					}
					else {
						var datos = {
							PoliticaId: politicacontenida[i].PoliticadependienteId,
							NombrePolitica: politicacontenida[i].NombrePoliticaDependiente
						};
						vm.tr[k].td.push(datos);
						j++;
					}
				}
				else {
					j = 1;
					k++;

					var adicion = {
						id: k,
						td: [{
							PoliticaId: politicacontenida[i].PoliticadependienteId,
							NombrePolitica: politicacontenida[i].NombrePoliticaDependiente
						}]
					};
					vm.tr.push(adicion)
				}
			}
		}

