		function cargargruposetnicos(fuenteid, politicaprincipalid, localizacionid, dimension) {

			vm.DimensionId = dimension;

			vm.CruceProgramacionSeguimiento.Fuentes.forEach(f => {
				if (f.FuenteId == fuenteid) {
					f.Politicas.forEach(p => {
						if (p.PoliticaPrincipalId == politicaprincipalid) {
							p.Localizaciones.forEach(l => {
								if (l.LocalizacionId == localizacionid) {
									l.VerLocalizacion = true;
									if (dimension == undefined) {
										l.vertabge = false;
									}
									else {
										l.vertabge = true;
									}
									MostrarPoliticasGRuposEtnicosContenidas(0, fuenteid, politicaprincipalid, localizacionid, vm.CruceProgramacionSeguimiento.ListaPoliticasGruposEtnicos[0].PoliticaId);
								}
								else {
									l.vertabge = false;
									l.VerLocalizacion = false;
								}
							});
						}
					});

				}
			});

			setTimeout(function () {
				PintarValidaciones();
			}, 500);



		}

		function PintarValidaciones() {
			if (JSON.parse(localStorage.getItem('ErroresRAFOCCRUCE')) != null) {
				var erroresvalidar = JSON.parse(localStorage.getItem('ErroresRAFOCCRUCE'));
				if (erroresvalidar.length > 0) {
					var erroresActivos = [];

					erroresvalidar.forEach(error => {
						var valor = 0;


						var erroresActivos = {
							Error: error.Error,
							descripcion: error.Descripcion,
							Data: error.Data
						};
						var valorw = 0;
						switch (error.Error) {
							case "AVFOCRUCOM":
								vm.validarAVFOCRUCOM(erroresActivos);
								break;
							case "AVFOCRUBEN":
								vm.validarAVFOCRUBEN(erroresActivos);
								break;
							default:
								break;
						}

					});
				}
			}
		}

